	stream.write(JSON.stringify(speedups_cold_responseEnd));
	stream.write(",");
	stream.end();

	stream = fs.createWriteStream("./top_results/speedups_cold_domResponse.txt", {flags:'a'});
	stream.write(JSON.stringify(speedups_cold_domResponse));
	stream.write(",");
	stream.end();

	stream = fs.createWriteStream("./top_results/speedups_warm_responseStart.txt", {flags:'a'});
	stream.write(JSON.stringify(speedups_warm_responseStart));
	stream.write(",");
